tables.table_schema:
CREATE TABLE ProteinAnnotations (
  protein_id INT PRIMARY KEY,
  protein_name VARCHAR(50) NOT NULL,
  protein_function TEXT,
  gene_symbol VARCHAR(20)
);

CREATE TABLE proteins (
    protein_id UUID PRIMARY KEY,
    protein_name VARCHAR(100),
    gene_name VARCHAR(100),
    molecular_weight FLOAT,
    function VARCHAR(255)
);

CREATE TABLE interaction_annotations (
    interaction_id UUID PRIMARY KEY,
    annotation TEXT,
    publication_id UUID,
    annotation_date DATE
);

CREATE TABLE protein_interaction_network (
    protein_id INT PRIMARY KEY,
    protein_name VARCHAR(255),
    interaction_partner_id INT,
    interaction_strength FLOAT
);

CREATE TABLE protein_interaction_partner (
    partner_id INT PRIMARY KEY,
    partner_name VARCHAR(255),
    interaction_count INT
);

CREATE TABLE protein_interaction_type (
    type_id INT PRIMARY KEY,
    interaction_type VARCHAR(50)
);
